import React from "react";
import { Box } from "@material-ui/core";

const CyberJobsLogo = () => {
  return (
    <Box>
      <img
        className="logo-cyberjobs"
        height="100px"
        src="/images/logo-cyberjobs.png"
      />
    </Box>
  );
};

export default CyberJobsLogo;
